function BuildCard({ el }) {
  //console.log(el.photos[0]);
  return (
    <main>
      <div>
        <div>
          {/*begin of image map here */}
          <div>
            {el.photos.map((el) =>
              el.backgroundimage.map((el) => <img src={el.path} className='gallery-image' alt='' />)
            )}
            <div>
              <li>{el.buildname}</li>
              <ul>
                <li className='gallery-item-likes'>
                  <span className='visually-hidden'>Likes:</span>
                  <i className='fas fa-heart' aria-hidden='true' /> 66
                </li>
                <li className='gallery-item-comments'>
                  <span className='visually-hidden'>Comments:</span>
                  <i className='fas fa-comment' aria-hidden='true' /> 2
                </li>
              </ul>
            </div>
            {/*end of image */}
          </div>
        </div>
        {/* End of gallery */}
      </div>
      {/* End of container */}
    </main>
  );
}

export default BuildCard;
